import { signOut } from "firebase/auth";
import { auth } from "../../firebase.js";

function Home() {
  const handleSignOut = () => {
    signOut(auth).catch((err) => {alert('not')});
  };
  return (
    <div>
      <h1>Home</h1>
      <button onClick={handleSignOut}>SignOut</button>
    </div>
  );
}

export default Home;
